import React from 'react';

function Dashboard({ user }) {
  return (
    <div>
      <h2>Bảng điều khiển</h2>
      <p>Xin chào {user.email} ({user.role})</p>
      {user.role === 'admin' ? (
        <div className="alert alert-warning">Bạn đang đăng nhập với quyền Admin.</div>
      ) : (
        <div className="alert alert-info">Bạn đang đăng nhập với quyền User.</div>
      )}
    </div>
  );
}

export default Dashboard;
